import React from "react";
import "./Nav.css";
import { Link } from "react-router-dom";

export default function Nav() {
  return (
    <div>
      <ul className="nav-list">
        <Link to="/" s>
          <li className="nav-login">Login</li>
        </Link>
        <Link to="/register">
          <li>Sign Up</li>
        </Link>
      </ul>
    </div>
  );
}
